        public static bool DecodeBnut(MemoryStream DecodeStream)
        {
            var buffer = DecodeStream.ToArray();
            var buf_len = buffer.Length;
            var offset = buf_len & 0xFF;

            for (int i = 0; i < buf_len; i++)
            {
                buffer[i] ^= xor_table[(i + offset) % xor_table.Length];
            }


            //Check everything has decoded
            if (buffer != null && buffer.Length > 0)
            {
                DecodeStream.SetLength(0); //empty the stream
                DecodeStream.Write(buffer, 0, buffer.Length); //write the decoded bytes back
                DecodeStream.Position = 0;

                return true;
            }
            return false;
        }

        public static bool ExtractText(Stream SourceStream, out String[] DestStrings)
        {
            var list = new List<string>();
            using (var sr = new StreamReader(SourceStream))
            {
                string line;
                while ((line = sr.ReadLine()) != null)
                {
                    list.Add(line);
                }
            }

            DestStrings = list.ToArray();
            return true;
        }
    }
